import axios from "axios";
import { useState } from "react";

function RegInput() {
  const [regNo, setRegNo] = useState("");

  const handleChangeReg = (event) => {
    setRegNo(event.target.value);
  };

  const searchRegNo = async (regNo) => {
    try {
      const carInfo = await axios.get(
        `https://beta.check-mot.service.gov.uk/trade/vehicles/mot-tests?registration=${regNo}`,
        {
          headers: {
            "x-api-key": "fZi8YcjrZN1cGkQeZP7Uaa4rTxua8HovaswPuIno",
          },
        }
      );
      return carInfo;
    } catch (e) {
      console.error(e);
    }
  };

  const handleSearchRegNo = async () => {
    const regNo = {
      text,
    };
    const carInfo = await searchRegNo(regNo);
    setRegNo(() => "");
  };

  return (
    <div>
      <h1>Add Reg Number Here</h1>
      <form>
        <input
          id="text"
          value=""
          type="text"
          label="Add Reg"
          onChange={handleChangeReg}
        />
        <button onClick={handleSearchRegNo}>Add Comment</button>
      </form>
    </div>
  );
}

export default RegInput;
